import React from 'react';
import logo from './logo.svg';
import './App.css';
import Tree from 'react-d3-tree';

const myTreeData = [
  {
    name: 'Top Level',
    attributes: {
      keyA: 'val A',
      keyB: 'val B',
      keyC: 'val C',
    },
    children: [
      {
        name: 'Level 2: A',
        attributes: {
          keyA: 'val A',
          keyB: 'val B',
          keyC: 'val C',
        },
      },
      {
        name: 'Level 2: B',
      },
    ],
  },
];

function App() {
  return (
    <div className="App" style={{ marginTop: '20%' }}>
      <div id="treeWrapper" style={{ width: '50em', height: '20em' }}>

        <Tree data={myTreeData} />

      </div>
    </div>
  );
}

export default App;
